      pn_auditee: null,
      content_laporan_temuan_minor:
        '<p style="text-align:center; margin: 5px 0;"> <span class="text-big"><strong>BERITA ACARA&nbsp;</strong></span> </p> <p style="text-align:center; margin: 5px 0;"> <span class="text-big"><strong>PENYERAHAN TEMUAN KATEGORI MINOR</strong></span> </p> <p style="text-align:center; margin: 5px 0;"> <span class="text-big"><strong>KANCA BRI TEKNOLOGI INFORMASI</strong></span> </p> <p style="text-align:center; margin: 5px 0;"> <span class="text-big"><strong>PERIODE AUDIT 2023</strong></span> </p> <hr> <p style="text-indent: 1rem; line-height: 1.6;"> Menindak lanjuti Surat AIW No. [INPUT_NOMOR_SURAT_DIO] . Perihal Surat Pemberitahuan Audit tanggal [INPUT_TGL_SPA], maka :&nbsp; </p> <div class="table"> <table style="margin: 0 5rem; line-height: 1.6;"> <tbody> <tr> <td style="min-width: 10em;"> Hari&nbsp; </td> <td> : tuesday </td> </tr> <tr> <td> Tanggal </td> <td> : 27/Juni/2023 </td> </tr> <tr> <td> Waktu </td> <td> : 6:20 </td> </tr> <tr> <td> Unit Kerja </td> <td> : 5 - DIVISI TEKNOLOGI INFORMASI </td> </tr> </tbody> </table> </div> <p style=" line-height: 1.6;"> telah diserahkan 0 Temuan Audit Kategori Minor dengan rincian temuan audit terlampir . Sehubungan dengan hal tersebut, diminta kepada Saudara untuk melakukan perbaikan kelemahan pengendalian intern secara menyeluruh yang tidak terbatas pada kelemahan yang menjadi temuan. Selanjutnya, kami akan melakukan evaluasi efektivitas sistem pengendalian intern pada periode audit berikutnya. </p> <p style=" line-height: 1.6;"> Demikian, berita acara ini dibuat dengan sebenar-benarnya. </p>',
